import React from 'react';
import './HeroSection.css';
import '../App.css';

function Video() {
  return (
    <figure className='image-container'>
      <img src='./images/Peopleschoice.jpg' alt='Example' className='hero-image' />
      <figcaption className='image-title'>Example Image</figcaption>
    </figure>
  );
}

export default Video;
